import './App.css';
import Profile from "./Profile";
import Learn from "./Learn";
import Interests from "./Interests";
import Square from "./Square";
import Expectation from "./Expectation";

function App() {
  return (
    <div className="App">
        <div className="container">
            <Square title={"Perfil"} contents={["20 años", "Estado de México", "Estudio Ciencias de la computación", "Revolotoso, sensible y apasionado"]}/>
            <Square title={"Hobbies"} contents={["Tomar fotografías", "Cocinar vegano", "Subirme a un columpio", "Reirme con mi novio"]}/>
            <Square title={"Expectativas"} contents={["Eqiovoxarme tanto que aprenda en el camino", "Despertar más curiosidad en mí por React", "Comenzar a ser más productivo y operacional en front", "Entender cómo funciona el front usando una librería"]}/>
            <Square title={"Qué quiero aprender"} contents={["A nadar", "A equivocarme y aprender de ello", "A expresar mis emociones", "A coexistir con lxs demás"]}/>
            <Square title={"Intereses"} contents={["Tomar fotografías", "Cocinar vegano", "Subirme a un columpio", "Reirme con mi novio"]}/>
        </div>
    </div>
  );
}

export default App;
